//assignment 3

import { useState } from 'react';
import './App.css';

function App() {
  let [amount, setAmount] = useState('');
  let [type, setType] = useState('income');
  let [transactions, setTransactions] = useState([]);

  function handleInput(e) {
    setAmount(e.target.value);
  }

  function handleType(e) {
    setType(e.target.value);
  }

  function handleClick() {
    if (!amount || isNaN(amount)) {
      alert('Enter a valid number');
      return;
    }

    setTransactions([...transactions, { amount: parseFloat(amount), type }]);
    setAmount('');
    setType('income');
  }

  // Calculate income, expense and balance
  const income = transactions
    .filter((t) => t.type === 'income')
    .reduce((sum, t) => sum + t.amount, 0);

  const expense = transactions
    .filter((t) => t.type === 'expense')
    .reduce((sum, t) => sum + t.amount, 0);

  const balance = income - expense;

  return (
    <>
      <h1>Expense Management System</h1>

      <p>Total Income = {income}</p>
      <p>Total Expense = {expense}</p>
      <p>Balance = {balance}</p>

      <div style={{ display: 'flex', gap: '30px', justifyContent: 'center' }}>
        <input value={amount} onChange={handleInput} type="text" placeholder="Amount" />
        <select value={type} onChange={handleType}>
          <option value="income">income</option>
          <option value="expense">expense</option>
        </select>
        <button onClick={handleClick}>submit</button>
      </div>

      <div>
        {transactions.map((value, index) => (
          <div key={index}>
            <h3>{value.amount} {value.type}</h3>
          </div>
        ))}
      </div>
    </>
  );
}

