import { useEffect, useState } from 'react'
import './App.css'

function App() {
  let [quiz, setQuiz] = useState([])
  let [index, setIndex] = useState(0)
  let [score, setScore] = useState(0)
  let [selected, setSelected] = useState(null)
  let [skipped, setSkipped] = useState([])
  let [showSkippedOnly, setShowSkippedOnly] = useState(false)
  let [options, setOptions] = useState([])

  useEffect(() => {
    fetch('https://the-trivia-api.com/v2/questions')
      .then(res => res.json())
      .then(data => {
        setQuiz(data)
        setOptions(shuffleOptions(data[0]))
      })
  }, [])

  function shuffleOptions(q) {
    let all = [...q.incorrectAnswers, q.correctAnswer]
    return all.sort(() => Math.random() - 0.5)
  }

  function handleOption(option) {
    setSelected(option)
    if (option === quiz[index].correctAnswer) {
      setScore(score + 1)
    }
  }

  function goToNext() {
    setSelected(null)

    if (!showSkippedOnly && index + 1 < quiz.length) {
      setIndex(index + 1)
      setOptions(shuffleOptions(quiz[index + 1]))
    } else if (!showSkippedOnly && skipped.length > 0) {
      setShowSkippedOnly(true)
      setIndex(skipped[0])
      setSkipped(skipped.slice(1))
      setOptions(shuffleOptions(quiz[skipped[0]]))
    } else if (showSkippedOnly && skipped.length > 0) {
      setIndex(skipped[0])
      setSkipped(skipped.slice(1))
      setOptions(shuffleOptions(quiz[skipped[0]]))
    } else {
      setIndex(quiz.length)
    }
  }

  function handleSkip() {
    if (!skipped.includes(index)) {
      setSkipped([...skipped, index])
    }
    goToNext()
  }

  function handlePrevious() {
    if (index > 0) {
      setIndex(index - 1)
      setOptions(shuffleOptions(quiz[index - 1]))
      setSelected(null)
    }
  }

  function handleRestart() {
    setIndex(0)
    setScore(0)
    setSelected(null)
    setSkipped([])
    setShowSkippedOnly(false)
    setOptions(shuffleOptions(quiz[0]))
  }

  if (!quiz.length) {
    return <h1 className="loading">Loading...</h1>
  }

  if (index >= quiz.length) {
    return (
      <div className="container">
        <h1>Quiz Ended</h1>
        <h2>Your Score: {score} / {quiz.length}</h2>
        <button onClick={handleRestart} className="btn">Restart</button>
      </div>
    )
  }

  return (
    <div className="container">
      <h2>Quiz App using React</h2>
      <h3>Score: {score}</h3>
      <h3>Question {index + 1} of {quiz.length}</h3>

      <h2>{quiz[index].question.text}</h2>

      {
        options.map((opt, i) => (
          <div key={i}>
            <button
              className="btn"
              onClick={() => handleOption(opt)}
              disabled={selected !== null}
              style={{
                backgroundColor: selected
                  ? opt === quiz[index].correctAnswer
                    ? 'lightgreen'
                    : opt === selected
                      ? 'salmon'
                      : ''
                  : ''
              }}
            >
              {opt}
            </button>
          </div>
        ))
      }

      <div className="button-group">
        <button onClick={handlePrevious} className="btn" disabled={index === 0}>Previous</button>
        <button onClick={handleSkip} className="btn">Skip</button>
        <button onClick={goToNext} className="btn" disabled={!selected}>Next</button>
      </div>
    </div>
  )
}

